import "../Css-files/home.css"



export default function Home() {
  class MyComponent extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        users: []
      };
    }

    componentDidMount() {
      fetch("https://jsonplaceholder.typicode.com/users/")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              users: result.users
            });
          },
          // Note: it's important to handle errors here
          // instead of a catch() block so that we don't swallow
          // exceptions from actual bugs in components.
          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }

    render() {
      const { error, isLoaded, users } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <ul>
            {users.map(users => (
              <li key={users.id}>
                {users.name} {users.price}
              </li>
            ))}
          </ul>
        );
      }
    }
  }

  return (

<div>  
  <h1 className="title"> Looking for a specific food or destination? Let TravelEat help!</h1>
  <div className="container"> 
    <div>    
        <input id="firstSearchField" className="searchContainer" type="text" placeholder="Food or Destination"></input>
        <input id="secondSearchField" className="secondSearchContainer" type="text" placeholder="Food or Destination"></input> 
    </div>
  </div>
    <button id="findButton" className="searchButton" onClick={componentDidMount()}type="button">Find</button>
    <div id="result" className="returnedResult"></div>


</div> 


  );
}
